import './AddEditNotes.css';

const AddEditNotes = (props:any) => {
  return (
    <div>
        {props.selectedNote ? <div className='edit-buttons'>
            <button type='submit' onClick={props.handleUpdateNote}>Save</button>
            <button onClick={props.handleCancel}>Cancel</button>
            </div> : <><button onClick={props.handleAddNote}>Add Note</button></>
        }    
  </div>
  )
}

export default AddEditNotes
